            """Computes gradient of the Mish activation function for backpropagation, returning the derivative with
            respect to the input.
            """
            x = ctx.saved_tensors[0]
            sx = torch.sigmoid(x)
            fx = F.softplus(x).tanh()
            return grad_output * (fx + x * sx * (1 - fx * fx))
